eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   articles: () => (/* binding */ articles),\n/* harmony export */   blogs: () => (/* binding */ blogs),\n/* harmony export */   categories: () => (/* binding */ categories),\n/* harmony export */   getArticleBySlug: () => (/* binding */ getArticleBySlug),\n/* harmony export */   getArticles: () => (/* binding */ getArticles),\n/* harmony export */   getArticlesByCategory: () => (/* binding */ getArticlesByCategory),\n/* harmony export */   getBlogBySlug: () => (/* binding */ getBlogBySlug),\n/* harmony export */   getBlogs: () => (/* binding */ getBlogs),\n/* harmony export */   getCategories: () => (/* binding */ getCategories),\n/* harmony export */   getFeaturedArticles: () => (/* binding */ getFeaturedArticles)\n/* harmony export */ });\n/* harmony import */ var _authors__WEBPACK_IMPORTED_MODULE_0__ = __webpack_require__(/*! ./authors */ \"(rsc)/./lib/authors.ts\");\n\n// Helper function to get author objects by slugs\nfunction getAuthorsBySlug(authorSlugs) {\n    if (!Array.isArray(authorSlugs)) return [];\n    return authorSlugs.filter((slug)=>typeof slug === \"string\" && slug.length > 0).map((slug)=>{\n        const author = _authors__WEBPACK_IMPORTED_MODULE_0__.authors.find((author)=>author.slug === slug);\n        return author || {\n            slug: slug,\n            name: \"Unknown Author\",\n            email: \"unknown@example.com\"\n        };\n    });\n}\n// Static data for articles\nconst articles = [\n    {\n        slug: \"supreme-court-landmark-decision\",\n        title: \"Supreme Court's Landmark Decision on Digital Privacy Rights\",\n        // Multiple authors\n        authors: getAuthorsBySlug([\n            \"prof-sarah-johnson\",\n            \"dr-michael-chen\"\n        ]),\n        // Keep for backward compatibility\n        author: \"Prof. Sarah Johnson\",\n        authorSlug: \"prof-sarah-johnson\",\n        date: \"April 15, 2024\",\n        readTime: 8,\n        image: \"/placeholder.svg?height=600&width=800\",\n        type: \"journal\",\n        doi: \"10.1234/lij.2024.0401\",\n        keywords: [\n            \"Fourth Amendment\",\n            \"Digital Privacy\",\n            \"Supreme Court\",\n            \"Constitutional Law\"\n        ],\n        excerpt: \"An analysis of the recent Supreme Court ruling that significantly expands digital privacy protections under the Fourth Amendment.\",\n        content: \"The Supreme Court's recent 7-2 decision in United States v. Thompson marks a watershed moment in Fourth Amendment jurisprudence, establishing new boundaries for government surveillance in the digital age.\\n\\nWriting for the majority, Chief Justice Roberts emphasized that 'the Fourth Amendment was not frozen in time at the founding era' and must adapt to technological changes that have fundamentally altered how Americans store and share personal information.\\n\\nThe ruling establishes a new test for determining when government access to digital records constitutes a search requiring a warrant. Under this framework, officials must obtain a warrant before accessing data that reveals 'intimate details of a person's life' regardless of whether that information is held by third parties.\\n\\nThis decision effectively overturns aspects of the 'third-party doctrine' established in Smith v. Maryland (1979), which held that individuals have no reasonable expectation of privacy in information voluntarily disclosed to third parties.\\n\\nLegal scholars have described the ruling as 'revolutionary' and 'the most significant Fourth Amendment decision in decades.' Professor Alan Dershowitz of Harvard Law School noted that 'this opinion recognizes that digital is different' and that traditional legal frameworks must evolve to address modern privacy concerns.\\n\\nThe immediate impact of the decision will be felt in ongoing investigations that rely on warrantless access to digital records. Law enforcement agencies will need to revise their procedures and obtain warrants in a wider range of circumstances.\\n\\nThe ruling also has implications for legislative efforts to regulate data privacy. Congress may need to revisit pending bills to ensure they align with the Court's expanded view of constitutional privacy protections.\"\n    },\n    {\n        slug: \"constitutional-interpretation-debate\",\n        title: \"The Ongoing Debate: Living Constitution vs. Originalism\",\n        // Multiple authors\n        authors: getAuthorsBySlug([\n            \"dr-michael-chen\",\n            \"prof-james-wilson\"\n        ]),\n        author: \"Dr. Michael Chen\",\n        authorSlug: \"dr-michael-chen\",\n        date: \"March 28, 2024\",\n        readTime: 12,\n        image: \"/placeholder.svg?height=600&width=800\",\n        type: \"journal\",\n        doi: \"10.1234/lij.2024.0328\",\n        keywords: [\n            \"Constitutional Interpretation\",\n            \"Originalism\",\n            \"Living Constitution\",\n            \"Judicial Philosophy\"\n        ],\n        excerpt: \"Examining the philosophical divide between 'living constitutionalism' and 'originalism' in contemporary legal thought.\",\n        content: \"The debate between 'living constitutionalism' and 'originalism' continues to shape American jurisprudence, with profound implications for how courts interpret the Constitution in addressing modern challenges.\\n\\nOriginalism, championed by the late Justice Antonin Scalia and current Justices Clarence Thomas and Neil Gorsuch, holds that the Constitution should be interpreted according to its original public meaning at the time of ratification. Adherents argue this approach constrains judicial discretion and preserves democratic governance by requiring constitutional changes to occur through the amendment process rather than judicial interpretation.\\n\\nIn contrast, proponents of living constitutionalism, including the late Justice Ruth Bader Ginsburg and current Justice Sonia Sotomayor, contend that the Constitution must be interpreted in light of evolving societal norms and conditions. They argue that the Framers intentionally used broad language to create a document that could adapt to changing circumstances without requiring formal amendment.\\n\\nRecent Supreme Court decisions reflect this ongoing tension. In Bostock v. Clayton County (2020), Justice Gorsuch, despite his originalist philosophy, authored a majority opinion extending Title VII protections to LGBTQ+ employees based on a textualist reading of 'discrimination because of sex.' This decision prompted debate about the relationship between originalism and textualism.\\n\\nMeanwhile, in cases involving the Second Amendment, such as New York State Rifle & Pistol Association v. Bruen (2022), the Court has embraced a more explicitly originalist approach, examining historical traditions of firearms regulation to determine the constitutionality of modern gun control measures.\\n\\nLegal scholars continue to refine these interpretive theories. Some have proposed intermediate approaches, such as 'original methods originalism,' which looks to the interpretive methods used at the founding, or 'common-good constitutionalism,' which emphasizes the Constitution's role in promoting the common welfare.\\n\\nAs the Court confronts novel constitutional questions arising from technological change, economic globalization, and evolving social norms, the debate between these interpretive philosophies will remain central to American constitutional law.\"\n    },\n    // Update the remaining articles similarly...\n    {\n        slug: \"federalism-modern-challenges\",\n        title: \"Federalism in the Face of Modern Challenges\",\n        authors: getAuthorsBySlug([\n            \"prof-james-wilson\",\n            \"lisa-montgomery\"\n        ]),\n        author: \"Prof. James Wilson\",\n        authorSlug: \"prof-james-wilson\",\n        date: \"March 10, 2024\",\n        readTime: 10,\n        image: \"/placeholder.svg?height=600&width=800\",\n        type: \"journal\",\n        doi: \"10.1234/lij.2024.0310\",\n        keywords: [\n            \"Federalism\",\n            \"State Rights\",\n            \"Federal Power\",\n            \"Climate Policy\",\n            \"Healthcare\",\n            \"COVID-19\"\n        ],\n        excerpt: \"How the traditional balance of state and federal power is being tested by contemporary issues like climate change and healthcare.\",\n        content: \"The American system of federalism—the division of power between national and state governments—faces unprecedented challenges in the 21st century as policymakers grapple with issues that transcend traditional jurisdictional boundaries.\\n\\nClimate change presents perhaps the most significant test of federalism's capacity to address collective action problems. While the federal government has authority to regulate interstate commerce and negotiate international agreements, effective climate policy requires coordination across all levels of government. States like California and New York have implemented ambitious climate initiatives in the absence of comprehensive federal action, creating a patchwork of regulations that businesses must navigate.\\n\\nThe COVID-19 pandemic similarly exposed tensions in federal-state relations. The federal government's limited public health infrastructure required reliance on state and local health departments for implementation of testing, contact tracing, and vaccination programs. Conflicting federal guidance and state policies created confusion and hampered coordinated response efforts.\\n\\nHealthcare reform continues to illustrate federalism's complexities. The Affordable Care Act's Medicaid expansion, designed as a federal-state partnership, became optional for states following the Supreme Court's decision in NFIB v. Sebelius (2012). This ruling preserved state autonomy but created disparities in healthcare access based on state residence.\\n\\nTechnological innovation also challenges traditional federalist boundaries. Internet regulation, cryptocurrency oversight, and data privacy protection all raise questions about the appropriate level of government for regulatory authority. The European Union's General Data Protection Regulation has influenced state-level privacy laws in California and Virginia, demonstrating how global standards can shape domestic policy at the state level.\\n\\nScholars have proposed various adaptations to address these challenges, including 'polyphonic federalism,' which emphasizes dialogue and coordination across levels of government, and 'democratic experimentalism,' which views states as laboratories for policy innovation. Others advocate for clearer federal preemption in areas requiring national uniformity.\\n\\nAs Justice Louis Brandeis noted in 1932, federalism allows states to serve as 'laboratories of democracy.' Today's complex challenges may require new experiments in governance that preserve federalism's benefits while addressing problems that transcend traditional boundaries.\"\n    },\n    {\n        slug: \"judicial-independence-threats\",\n        title: \"Judicial Independence Under Threat\",\n        authors: getAuthorsBySlug([\n            \"lisa-montgomery\",\n            \"dr-rebecca-torres\"\n        ]),\n        author: \"Lisa Montgomery\",\n        authorSlug: \"lisa-montgomery\",\n        date: \"February 22, 2024\",\n        readTime: 7,\n        image: \"/placeholder.svg?height=600&width=800\",\n        type: \"blog\",\n        keywords: [\n            \"Judicial Independence\",\n            \"Court Packing\",\n            \"Judicial Ethics\",\n            \"Separation of Powers\"\n        ],\n        excerpt: \"Examining growing concerns about political influence on the judiciary and proposals to safeguard judicial independence.\",\n        content: \"Judicial independence, a cornerstone of constitutional democracy, faces mounting challenges in the United States and globally as courts become increasingly entangled in partisan political disputes.\\n\\nRecent polling indicates declining public confidence in the Supreme Court's impartiality, with approval ratings reaching historic lows following controversial decisions on abortion, voting rights, and executive power. This perception crisis threatens the judiciary's legitimacy and its ability to function as an independent check on the political branches.\\n\\nCalls for structural reforms have intensified, including proposals to expand the Supreme Court, implement term limits for justices, strengthen recusal standards, and establish binding ethics rules. Proponents argue these measures would enhance legitimacy and reduce politicization, while critics contend they could undermine judicial independence and stability.\\n\\nAt the state level, judicial independence faces different threats. Thirty-eight states hold some form of judicial elections, exposing judges to political pressure and campaign finance concerns. Studies show correlations between campaign contributions and judicial decision-making in business and criminal cases, raising due process questions highlighted in Caperton v. A.T. Massey Coal Co. (2009).\\n\\nInternationally, judicial independence has deteriorated in countries including Poland, Hungary, and Turkey, where governments have removed judges, packed courts, and restricted judicial authority. These developments offer cautionary examples of how quickly judicial independence can erode when political actors target courts.\\n\\nHistorically, the U.S. judiciary has weathered political storms, including President Franklin Roosevelt's court-packing plan and congressional jurisdiction-stripping attempts. However, current challenges occur against a backdrop of heightened polarization and declining institutional trust.\\n\\nLegal scholars emphasize that judicial independence requires both structural protections and cultural norms. As Professor Richard Fallon of Harvard Law School notes, 'Judicial independence ultimately depends on a shared commitment to constitutional values that transcends partisan differences.'\\n\\nPreserving judicial independence while ensuring accountability and legitimacy remains a central challenge for American constitutional democracy in the twenty-first century.\"\n    },\n    {\n        slug: \"first-amendment-digital-age\",\n        title: \"First Amendment in the Digital Age\",\n        authors: getAuthorsBySlug([\n            \"dr-rebecca-torres\",\n            \"prof-elena-rodriguez\"\n        ]),\n        author: \"Dr. Rebecca Torres\",\n        authorSlug: \"dr-rebecca-torres\",\n        date: \"February 5, 2024\",\n        readTime: 9,\n        image: \"/placeholder.svg?height=600&width=800\",\n        type: \"blog\",\n        keywords: [\n            \"First Amendment\",\n            \"Free Speech\",\n            \"Social Media\",\n            \"Content Moderation\",\n            \"Section 230\"\n        ],\n        excerpt: \"How traditional First Amendment doctrines are being applied to new digital contexts, from social media regulation to AI-generated speech.\",\n        content: \"First Amendment jurisprudence faces unprecedented challenges as digital technologies transform how speech is created, disseminated, and regulated in ways the Framers could never have anticipated.\\n\\nSocial media platforms now function as the modern public square, yet as private entities, they are not directly bound by the First Amendment. This creates a regulatory paradox: government efforts to require content moderation may constitute compelled speech, while mandating content neutrality could prevent platforms from removing harmful material.\\n\\nThe Supreme Court is beginning to address these tensions. In NetChoice v. Paxton, the Court is considering whether Texas and Florida laws restricting platforms' content moderation practices violate the First Amendment. The outcome will significantly shape the relationship between government regulation, platform governance, and free expression online.\\n\\nArtificial intelligence presents novel First Amendment questions. As AI systems generate increasingly sophisticated content, courts must determine whether such output constitutes protected speech and, if so, who holds the speech rights—the AI developer, the user, or perhaps the AI itself. The Court's commercial speech doctrine, which affords lesser protection to commercial advertising, may provide a framework for addressing AI-generated content.\\n\\nEncryption technology raises additional constitutional questions. Government attempts to mandate backdoor access to encrypted communications pit national security interests against free speech and privacy concerns. Some scholars argue that encryption code itself constitutes protected speech under Bernstein v. Department of Justice (1999).\\n\\nDeep fakes and synthetic media challenge traditional assumptions about false speech. While the First Amendment generally protects false statements under United States v. Alvarez (2012), the potential harm from sophisticated digital forgeries may justify narrowly tailored regulations when used to defame, defraud, or interfere with elections.\\n\\nProfessor Jack Balkin of Yale Law School has proposed a 'constitutional triangle' framework that balances traditional free speech protections with digital-age concerns about access and trustworthiness. This approach recognizes that meaningful free expression in the digital era requires not just freedom from government censorship but also access to communication channels and protection from manipulation and harassment.\\n\\nAs Justice Anthony Kennedy observed in Packingham v. North Carolina (2017), the Court must proceed with 'extreme caution' when applying First Amendment principles to the internet, recognizing both its unprecedented capacity for expression and its potential for harm.\"\n    },\n    {\n        slug: \"constitutional-rights-non-citizens\",\n        title: \"Constitutional Rights of Non-Citizens\",\n        authors: getAuthorsBySlug([\n            \"prof-elena-rodriguez\",\n            \"prof-sarah-johnson\"\n        ]),\n        author: \"Prof. Elena Rodriguez\",\n        authorSlug: \"prof-elena-rodriguez\",\n        date: \"January 18, 2024\",\n        readTime: 11,\n        image: \"/placeholder.svg?height=600&width=800\",\n        type: \"blog\",\n        keywords: [\n            \"Immigration Law\",\n            \"Constitutional Rights\",\n            \"Due Process\",\n            \"Equal Protection\",\n            \"Plenary Power\"\n        ],\n        excerpt: \"A comprehensive analysis of which constitutional protections extend to non-citizens within and outside U.S. borders.\",\n        content: \"The constitutional rights of non-citizens remain one of the most complex and contested areas of American constitutional law, with significant implications for immigration policy, national security, and international relations.\\n\\nContrary to popular belief, the Constitution extends many protections to non-citizens within U.S. territory. The Supreme Court established in Yick Wo v. Hopkins (1886) that the Fourteenth Amendment's equal protection clause applies to 'all persons' regardless of citizenship status. Similarly, in Wong Wing v. United States (1896), the Court held that non-citizens are entitled to Fifth and Sixth Amendment protections in criminal proceedings.\\n\\nHowever, the Court has recognized certain constitutional distinctions between citizens and non-citizens. In Mathews v. Diaz (1976), the Court upheld Congress's authority to limit certain federal benefits to citizens and long-term legal residents. The Court has also afforded Congress and the executive branch significant deference in immigration matters under the 'plenary power doctrine,' though this deference has limits, as demonstrated in Department of Homeland Security v. Regents (2020), which invalidated the Trump administration's rescission of the DACA program on procedural grounds.\\n\\nThe geographic reach of constitutional protections for non-citizens presents particularly challenging questions. In United States v. Verdugo-Urquidez (1990), the Court held that the Fourth Amendment does not apply to searches of non-citizens' property in foreign territories. However, in Boumediene v. Bush (2008), the Court extended habeas corpus rights to non-citizen detainees at Guantanamo Bay, emphasizing factors including the nature of the site and the practical obstacles to recognizing the right.\\n\\nThe treatment of asylum seekers and migrants at the border raises ongoing constitutional questions. In Department of Homeland Security v. Thuraissigiam (2020), the Court limited habeas corpus protections for asylum seekers in expedited removal proceedings, while leaving open broader questions about due process rights during initial entry.\\n\\nRecent immigration enforcement practices have prompted litigation over the detention conditions of non-citizens. Courts have generally recognized that the Due Process Clause prohibits punitive conditions for civil immigration detainees and requires adequate medical care, though the standard for determining what constitutes 'adequate' remains contested.\\n\\nThe rights of undocumented immigrants living within the United States present particular complexities. In Plyler v. Doe (1982), the Court held that states cannot deny undocumented children access to public education, recognizing the importance of education and the unfairness of penalizing children for their parents' actions. However, in other contexts, courts have permitted distinctions based on immigration status.\\n\\nAs Professor Hiroshi Motomura of UCLA School of Law observes, 'Constitutional rights for non-citizens reflect a tension between territorial presence as a basis for rights and membership in the political community as a prerequisite for full constitutional protection.' This tension continues to shape judicial decisions and policy debates in an era of global migration and transnational security concerns.\"\n    }\n];\n// Functions to get articles (now using static data)\nfunction getArticles(limit) {\n    const filteredArticles = articles.filter((article)=>article.type === \"journal\");\n    return limit ? filteredArticles.slice(0, limit) : filteredArticles;\n}\nfunction getArticleBySlug(slug) {\n    return articles.find((article)=>article.slug === slug) || null;\n}\nfunction getBlogs(limit) {\n    const blogs = articles.filter((article)=>article.type === \"blog\");\n    return limit ? blogs.slice(0, limit) : blogs;\n}\nfunction getBlogBySlug(slug) {\n    return articles.find((article)=>article.slug === slug && article.type === \"blog\") || null;\n}\nfunction getFeaturedArticles(limit = 4) {\n    // For static data, just return the first few articles as \"featured\"\n    return articles.slice(0, limit);\n}\nfunction getArticlesByCategory(category, limit) {\n    // Since we don't have categories in our static data, this is a simplified version\n    const filteredArticles = articles.filter((article)=>{\n        // Simulate category matching based on content or title\n        return article.title.toLowerCase().includes(category.toLowerCase()) || article.content.toLowerCase().includes(category.toLowerCase());\n    });\n    return limit ? filteredArticles.slice(0, limit) : filteredArticles;\n}\nfunction getCategories() {\n    // Return some static categories\n    return [\n        {\n            id: \"1\",\n            name: \"Constitutional Law\",\n            slug: \"constitutional-law\"\n        },\n        {\n            id: \"2\",\n            name: \"First Amendment\",\n            slug: \"first-amendment\"\n        },\n        {\n            id: \"3\",\n            name: \"Judicial Politics\",\n            slug: \"judicial-politics\"\n        },\n        {\n            id: \"4\",\n            name: \"Legal Theory\",\n            slug: \"legal-theory\"\n        },\n        {\n            id: \"5\",\n            name: \"Civil Rights\",\n            slug: \"civil-rights\"\n        }\n    ];\n}\n// Static blogs data for fallback\nconst blogs = articles.filter((article)=>article.type === \"blog\");\n// Static categories data for fallback\nconst categories = [\n    {\n        id: \"1\",\n        name: \"Constitutional Law\",\n        slug: \"constitutional-law\"\n    },\n    {\n        id: \"2\",\n        name: \"First Amendment\",\n        slug: \"first-amendment\"\n    },\n    {\n        id: \"3\",\n        name: \"Judicial Politics\",\n        slug: \"judicial-politics\"\n    },\n    {\n        id: \"4\",\n        name: \"Legal Theory\",\n        slug: \"legal-theory\"\n    },\n    {\n        id: \"5\",\n        name: \"Civil Rights\",\n        slug: \"civil-rights\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./lib/data.ts\n");

